        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eAn efficient implementation of maps from integer keys to values\n (dictionaries).\n\u003c/p\u003e\u003cp\u003eThis module re-exports the value lazy \u003ca\u003eData.IntMap.Lazy\u003c/a\u003e API, plus\n several deprecated value strict functions. Please note that these functions\n have different strictness properties than those in \u003ca\u003eData.IntMap.Strict\u003c/a\u003e:\n they only evaluate the result of the combining function. For example, the\n default value to \u003ccode\u003e\u003ca\u003einsertWith'\u003c/a\u003e\u003c/code\u003e is only evaluated if the combining function\n is called and uses it.\n\u003c/p\u003e\u003cp\u003eThese modules are intended to be imported qualified, to avoid name\n clashes with Prelude functions, e.g.\n\u003c/p\u003e\u003cpre\u003e  import Data.IntMap (IntMap)\n  import qualified Data.IntMap as IntMap\n\u003c/pre\u003e\u003cp\u003eThe implementation is based on \u003cem\u003ebig-endian patricia trees\u003c/em\u003e.  This data\n structure performs especially well on binary operations like \u003ccode\u003e\u003ca\u003eunion\u003c/a\u003e\u003c/code\u003e\n and \u003ccode\u003e\u003ca\u003eintersection\u003c/a\u003e\u003c/code\u003e.  However, my benchmarks show that it is also\n (much) faster on insertions and deletions when compared to a generic\n size-balanced map implementation (see \u003ca\u003eData.Map\u003c/a\u003e).\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e Chris Okasaki and Andy Gill,  \"\u003cem\u003eFast Mergeable Integer Maps\u003c/em\u003e\",\n      Workshop on ML, September 1998, pages 77-86,\n      \u003ca\u003ehttp://citeseer.ist.psu.edu/okasaki98fast.html\u003c/a\u003e\n\u003c/li\u003e\u003cli\u003e D.R. Morrison, \"/PATRICIA -- Practical Algorithm To Retrieve\n      Information Coded In Alphanumeric/\", Journal of the ACM, 15(4),\n      October 1968, pages 514-534.\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eOperation comments contain the operation time complexity in\n the Big-O notation \u003ca\u003ehttp://en.wikipedia.org/wiki/Big_O_notation\u003c/a\u003e.\n Many operations have a worst-case complexity of \u003cem\u003eO(min(n,W))\u003c/em\u003e.\n This means that the operation can become linear in the number of\n elements with a maximum of \u003cem\u003eW\u003c/em\u003e -- the number of bits in an \u003ccode\u003eInt\u003c/code\u003e\n (32 or 64).\n\u003c/p\u003e\u003c/div\u003e",
