        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eAn efficient implementation of ordered maps from keys to values\n (dictionaries).\n\u003c/p\u003e\u003cp\u003eAPI of this module is strict in both the keys and the values.\n If you need value-lazy maps, use \u003ca\u003eData.Map.Lazy\u003c/a\u003e instead.\n The \u003ccode\u003e\u003ca\u003eMap\u003c/a\u003e\u003c/code\u003e type is shared between the lazy and strict modules,\n meaning that the same \u003ccode\u003e\u003ca\u003eMap\u003c/a\u003e\u003c/code\u003e value can be passed to functions in\n both modules (although that is rarely needed).\n\u003c/p\u003e\u003cp\u003eThese modules are intended to be imported qualified, to avoid name\n clashes with Prelude functions, e.g.\n\u003c/p\u003e\u003cpre\u003e  import qualified Data.Map.Strict as Map\n\u003c/pre\u003e\u003cp\u003eThe implementation of \u003ccode\u003e\u003ca\u003eMap\u003c/a\u003e\u003c/code\u003e is based on \u003cem\u003esize balanced\u003c/em\u003e binary trees (or\n trees of \u003cem\u003ebounded balance\u003c/em\u003e) as described by:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e Stephen Adams, \"\u003cem\u003eEfficient sets: a balancing act\u003c/em\u003e\",\n     Journal of Functional Programming 3(4):553-562, October 1993,\n     \u003ca\u003ehttp://www.swiss.ai.mit.edu/~adams/BB/\u003c/a\u003e.\n\u003c/li\u003e\u003cli\u003e J. Nievergelt and E.M. Reingold,\n      \"\u003cem\u003eBinary search trees of bounded balance\u003c/em\u003e\",\n      SIAM journal of computing 2(1), March 1973.\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eNote that the implementation is \u003cem\u003eleft-biased\u003c/em\u003e -- the elements of a\n first argument are always preferred to the second, for example in\n \u003ccode\u003e\u003ca\u003eunion\u003c/a\u003e\u003c/code\u003e or \u003ccode\u003e\u003ca\u003einsert\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eOperation comments contain the operation time complexity in\n the Big-O notation (\u003ca\u003ehttp://en.wikipedia.org/wiki/Big_O_notation\u003c/a\u003e).\n\u003c/p\u003e\u003cp\u003eBe aware that the \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e, \u003ccode\u003eTraversable\u003c/code\u003e and \u003ccode\u003eData\u003c/code\u003e instances\n are the same as for the \u003ca\u003eData.Map.Lazy\u003c/a\u003e module, so if they are used\n on strict maps, the resulting maps will be lazy.\n\u003c/p\u003e\u003c/div\u003e",
